const initialState = {
    users: [],
    useredit: {},
}

export const CompanyReducer = (state = initialState, action) => {
    switch (action.type){
        case 'GETUSERS':
            return {...state, users: action.payload}
            case 'USEREDIT':
            return {...state, useredit: action.payload}
        default:
            return state
    }
}
